INSERT INTO `quiz_questions` (`id`, `quiz_id`, `question`, `option1`, `option2`, `option3`, `option4`, `correct_option`, `created_by`, `created_date`) VALUES
(5, 5, 'What does UXSS stand for?', 'Universal Cross-Site Scripting', 'Universal Cross-Site Security', 'Universal Cross-Site Safety', 'Universal Cross-Site Source', '1', 'admin', '2024-08-16 04:49:25'),
(6, 5, 'What differentiates UXSS from traditional XSS attacks?', 'UXSS targets vulnerabilities in web applications', 'UXSS targets vulnerabilities within the web browser or browser extensions', 'UXSS requires user interaction', 'UXSS only affects mobile devices', '2', 'admin', '2024-08-16 04:49:25'),
(7, 5, 'What is the main goal of a UXSS attack?', 'To exploit web applications', 'To execute arbitrary scripts within the browser environment', 'To manipulate server-side data', 'To access local files on the victim’s machine', '2', 'admin', '2024-08-16 04:49:25'),
(8, 5, 'How does UXSS bypass security features?', 'By exploiting server-side vulnerabilities', 'By bypassing the same-origin policy', 'By manipulating user sessions', 'By using encrypted connections', '2', 'admin', '2024-08-16 04:49:25'),
(9, 5, 'Which policy does UXSS typically bypass?', 'Cross-Origin Resource Sharing (CORS)', 'Content Security Policy (CSP)', 'Same-Origin Policy (SOP)', 'Domain Name System (DNS)', '3', 'admin', '2024-08-16 04:49:25'),
(10, 5, 'In the example provided, what does the onerror attribute in the img tag do?', 'Displays an error message', 'Writes a script to the document', 'Deletes the image', 'Triggers an alert box', '2', 'admin', '2024-08-16 04:49:25'),
(11, 5, 'What is the first step an attacker takes in a UXSS attack?', 'Craft a malicious script', 'Deliver the payload', 'Identify a vulnerable browser or extension', 'Execute the script', '3', 'admin', '2024-08-16 04:49:25'),
(12, 5, 'What kind of data might an attacker steal in a UXSS attack?', 'Credit card details', 'Session tokens and cookies', 'File contents', 'Password hashes', '2', 'admin', '2024-08-16 04:49:25'),
(13, 5, 'What could a malicious script do once executed in a UXSS attack?', 'Download files from the server', 'Intercept network traffic', 'Interact with any website the victim visits', 'Modify system files', '3', 'admin', '2024-08-16 04:49:25'),
(14, 5, 'Which of the following is a potential vector for UXSS?', 'Server configuration errors', 'Browser vulnerabilities', 'Incorrect file permissions', 'Weak encryption algorithms', '2', 'admin', '2024-08-16 04:49:25'),
(15, 5, 'Why are browser extensions potential UXSS vectors?', 'They often handle sensitive data', 'They have extensive permissions and may lack sufficient security checks', 'They are rarely updated', 'They are written in low-level programming languages', '2', 'admin', '2024-08-16 04:49:25'),
(16, 5, 'How can mobile apps become vulnerable to UXSS?', 'By using unsecured WebViews to display web content', 'By allowing external plugins', 'By not using SSL/TLS', 'By hardcoding credentials', '1', 'admin', '2024-08-16 04:49:25'),
(17, 5, 'In the example UXSS exploit code provided, what is the purpose of the img element?', 'To display a user profile picture', 'To send the victim\'s cookies to an attacker-controlled server', 'To load an external stylesheet', 'To open a new tab', '2', 'admin', '2024-08-16 04:49:25'),
(18, 5, 'What can be used to restrict the sources from which scripts can be executed?', 'Cross-Origin Resource Sharing (CORS)', 'Content Security Policy (CSP)', 'HTTP Strict Transport Security (HSTS)', 'Same-Origin Policy (SOP)', '2', 'admin', '2024-08-16 04:49:25'),
(19, 5, 'Why is it important to keep browsers and extensions updated?', 'To gain new features', 'To patch known vulnerabilities', 'To improve performance', 'To support legacy applications', '2', 'admin', '2024-08-16 04:49:25'),
(20, 5, 'Which of the following practices helps prevent UXSS?', 'Using trusted extensions', 'Disabling JavaScript', 'Clearing cookies regularly', 'Blocking pop-ups', '1', 'admin', '2024-08-16 04:49:25'),
(21, 5, 'What does the exploit code \"img.src\" do in the UXSS example?', 'Loads a script from the attacker\'s server', 'Modifies the webpage layout', 'Sends cookies to the attacker', 'Creates a broken image link', '3', 'admin', '2024-08-16 04:49:25'),
(22, 5, 'What should be regularly conducted to identify vulnerabilities in browser extensions?', 'User surveys', 'Security audits', 'Performance tests', 'Code reviews', '2', 'admin', '2024-08-16 04:49:25'),
(23, 5, 'What can be used to limit extension permissions?', 'Content Security Policy (CSP)', 'User account control', 'Browser settings', 'Antivirus software', '3', 'admin', '2024-08-16 04:49:25'),
(24, 5, 'What is one possible consequence of a successful UXSS attack?', 'Server crash', 'Loss of cookies or session tokens', 'Permanent data loss', 'Encryption failure', '2', 'admin', '2024-08-16 04:49:25'),
