(234, 3, 'Which practice is NOT recommended to prevent SQL injection?', 'Using stored procedures', 'Using dynamic SQL', 'Using prepared statements', 'Validating user input', '2', 'System', '2024-08-15 21:02:39'),
(235, 3, 'What could happen if an attacker injects \"; DROP TABLE Students;\" into a batched SQL statement?', 'Nothing happens', 'The Students table is renamed', 'The Students table is deleted', 'An error message is shown', '3', 'System', '2024-08-15 21:02:39'),
(236, 4, 'What is Blind SQL Injection?', 'A SQL injection where the results are visible.', 'A SQL injection where results are inferred indirectly.', 'A type of error-based SQL injection.', 'A SQL injection that only works on specific databases.', '2', 'admin', '2024-08-15 21:10:17'),
(237, 4, 'How does Boolean-based Blind SQL Injection work?', 'By manipulating the database schema.', 'By comparing the application’s response to true/false conditions.', 'By using errors to extract data.', 'By encrypting SQL queries.', '2', 'admin', '2024-08-15 21:10:38'),
(238, 4, 'What is the purpose of Time-based Blind SQL Injection?', 'To directly extract data from the database.', 'To delay the response and infer data from response time.', 'To cause the server to crash.', 'To generate error messages.', '2', 'admin', '2024-08-15 21:10:38'),
(239, 4, 'What can an attacker infer using Boolean-based Blind SQL Injection?', 'The structure of the database.', 'The existence of certain data.', 'The number of tables.', 'The database admin’s password.', '2', 'admin', '2024-08-15 21:10:38'),
(240, 4, 'What does a time delay in Time-based Blind SQL Injection indicate?', 'The query succeeded.', 'The query failed.', 'The application is vulnerable.', 'There is a network issue.', '3', 'admin', '2024-08-15 21:12:41'),
(241, 4, 'How does an attacker use Boolean-based Blind SQL Injection to check if a username exists?', 'By generating an error.', 'By using a time delay.', 'By comparing true and false conditions.', 'By directly querying the database.', '3', 'admin', '2024-08-15 21:12:41'),
(242, 4, 'What kind of response does an attacker observe in Time-based Blind SQL Injection?', 'The application crashes.', 'An error message.', 'A delayed response if the condition is true.', 'Immediate response regardless of the condition.', '3', 'admin', '2024-08-15 21:12:41'),
